      "content": "Emmy bogen handler om en piger der snart skal kornfirmeres. Hun får en dagbog af sin mormor, til at skrive om sin kornfirmation. Hun vil gerne holde hendes kornfirmation hos Hvide okse, men det må hun ikke for sin mor. Så derfor lejer hendes mor forsamlingshuset i stedet for. Men det vil Emmy ikke. Samtidigt må hendes vindene Shasa ikke blive kornfirmeret fordi hun ikke er døbt. Emmy og hendes anden vindene Kit, ville hjælpe Sasha. Emmy's mormor har hendes kornfirmation og bryllups kjole, som Sasha låner. Men den ender godt.",
