      "content": "Emmy er sådan en bog du kan relatere til med skænderier med irreterende forældre men også venskab, familien og ikke mindst KONFIRMATIONEN!! \r\nEmmy er en pige på 13 år der skal til at konfirmeres og hun skriver det hele ned i en IKKE DAGBOG!!! men en Konfirmations bog som Emmy fik af sin mormor hendes dejlige mormor med runde kinder og briller. Emmys mor mener at hun bare er konfirmations hys men Emmy mener at hun bare vil have en fin konfirmation på Hvide okse. Men man kan ikke lige frem sige at det hele går Emmys vej men heldigvis har Emmy sine to bedste veninder Sasja og Kit som altid kan få hende til at grine.  \r\nJeg anbefaler HELT KLART! at man læser denne bog der er altid! dejligt at få en brandgod læse oplevelse i sin sommerferie 5/6 stjerner herfra =)",
