      "pid": "870970-basis:29145253", "libraryId": "123456", "worktype": "book",
      "content": "Emmy er en pige, som mange andre. Hun har glædet sig i mange år til at blive konfirmeret. Hun finder så ud af at hun ikke er blevet døbt fordi hendes mor syndes at kristendom er noget pjat. Emmys fårældre er dog skilte og de skændes meget. Emmy vil jo bare havde den bedste konfirmation, men det går ikke så godt da hun høre at det skal holdes forsamlingshuset.\r\n\r\nEmmy serien er en virkelig god serie, og fyldt med masser små historie indimellem. den er beregnet til 10 - 14 årige     \r\n\r\n  ",
