      "pid": "870970-basis:29145253", "libraryId": "123456", "worktype": "book",
      "content": "Emmy skal snart konfirmeres. Hun har glædet sig til det i flere år. En dag kommer hendes mormor på besøg og har en gave med. I starten virker Emmy en anelse skeptisk, men ændrer mening. Det viser sig pludselig at det ikke er så nemt at blive konfirmeret alligevel. Veninden Sasha er ikke blevet døbt fordi hendes mor mener at kristendommen undertrykker kvinder. Emmys skilte forældre skændes meget vedrørende hendes konfirmation. Hendes mor går rigtig meget op i at lave en god fest for hende og hendes far virker temmelig ligeglad. Da moren fortæller Emmy at hun har booket forsamlingshuset bliver Emmy så utilfreds at hun går lidt for vidt.\r\n\r\nBEMÆRK\r\nDenne bog er IKKE en del af Emmy-serien.  ",
