      "pid": "870970-basis:29145253", "libraryId": "123456", "worktype": "book",
      "content": "Emmy handler om en 13-årige pige, som får en dagbog af sin mormor, som mormoren tænker at hun kan skrive konfirmationsdagbog i. Hendes forældre er skilt og Emmy har en storebror på 17 år der er rigtig irriterende. Da Emmy får dagbogen er der cirka 8 måneder til hun skal konfirmeres. Hun ved allerede hvordan festen skal være. Men da hun fortæller sin mor, hvordan hun gerne vil have det og ikke får det som hun vil, beslutter hun sig for at ringe til det sted, hvor hun gerne vil holde festen. Altså at snyde sin mor. Men hendes mor opdager det og så bliver det bare holdt hjemme hos hendes mor. Emmy bliver ked af at festen ikke bliver helt som hun havde tænkt, men hun får det bedre efter et lille stykke tid.\r\nDet ender med at hun får en god konfirmation alligevel.\r\nBogen er nok mest til piger fra 9 til 12 år.\r\nDen er meget spændende men ikke helt i top top.\r\n",
